import React from 'react'
import { Link } from 'react-router-dom'

const ChannelCard = ({channelDetail : {id: {channelId}, snippet}}) => {
  return (
    <div>
      <Link to={`/channelDetail/${channelId}`}>
        <div style={{display: 'flex', flexDirection: 'column', justifyContent: 'center', textAlign: 'center', color: 'black'}}>
          <img src={snippet?.thumbnails?.medium?.url}
          alt={snippet?.title}/>

          <p style={{fontSize: 14, margin: 0}}>{snippet?.title}</p>
        </div>
      </Link>
    </div>
  )
}

export default ChannelCard
